v17 brings a new base type for exceptions: RequestException. ApiRequestException inherits from RequestException and is thrown only when an actual error response with the correct body is received from the Bot API. In other situations RequestException will be thrown instead containing actual exception as InnerException if there is one, e.g. serialization or connection-related exceptions. If you used ApiRequestException and HttpRequestException to handle most exception now you have to replace HttpRequestException with RequestException and look for the inner exception. All valid errors with JSON body from Telegram are now thrown as ApiRequestException including 429: Too Many Requests. Since 5XX responses don't usually include correct JSON body they are thrown as RequestException with HttpRequestException inside. Look at the following example on how to handle different kinds of exceptions. You might not need to implement everything as you see, it's there only for demonstration purposes. try
{ await bot.SendTextMessageAsync(chatId, "Hello");
}
catch (ApiRequestException exception)
{ switch (exception.StatusCode) { case 400: // Handle incorrect requests exceptions break; case 401: // Handle incorrect bot token exception (revoked tokens) break; case 403: // Handle authorization exceptions (blocked users, unaccessible chats, etc) break; case 429: // Handle rate limiting exception break; default: // Handle other errors with valid json body: it includes status code and description of the error break; }
}
catch (RequestException exception)
{ if (exception.InnerException is HttpRequestException httpRequestException) { // Handle connection exceptions or 5XX exceptions from the Bot API } else if (exception.InnerException is JsonSerializationException serializationException) { // Handle serialization exception when a request or a response can't be serialized for some reason } else { // Handle all other exceptions }
}
catch (OperationCancelledException exception)
{ // Handle cancellation exception, e.g. when CancellationToken is cancelled
}

